var title_f21_10_21675="Components biophysical profile";
var content_f21_10_21675=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F79813&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F79813&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for the biophysical profile test",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <strong>",
"         Nonstress test:",
"        </strong>",
"        2 points if reactive, defined as at least 2 episodes of FHR accelerations of at least 15 bpm and at least 15 seconds duration from onset to return associated with fetal movement within a 30 minute observation period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Fetal breathing movements:",
"        </strong>",
"        2 points if one or more episodes of rhythmic breathing movements of &ge;30 seconds within a 30 minute observation period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Fetal tone:",
"        </strong>",
"        2 points if one or more episodes of extension of a fetal extremity or fetal spine with return to flexion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Amniotic fluid volume:",
"        </strong>",
"        2 points if a single pocket of fluid is present measuring at least 2 cm by 1 cm. However, some clinicians use other criteria such as the amniotic fluid index.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Fetal movement:",
"        </strong>",
"        2 points if three or more discrete body or limb movements within 30 minutes of observation. An episode of active continuous movement is counted as one movement.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    0 points are assigned for any criteria not met.",
"    <div class=\"footnotes\">",
"     bpm: beats per minute; FHR: fetal heart rate.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
