var title_f21_10_21676="Bacterial tracheitis DDx";
var content_f21_10_21676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81102&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81102&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of bacterial tracheitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Condition",
"      </td>",
"      <td class=\"subtitle1\">",
"       Characteristic features",
"      </td>",
"      <td class=\"subtitle1\">",
"       Radiographic features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Bacterial tracheitis",
"      </td>",
"      <td>",
"       Fever; toxic appearance",
"      </td>",
"      <td>",
"       Intraluminal membranes and tracheal wall irregularity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Epiglottitis",
"      </td>",
"      <td>",
"       Fever, toxic appearance; anxiety out of proportion to degree of respiratory distress; \"tripod\" and/or \"sniffing\" posture; drooling",
"      </td>",
"      <td>",
"       Swollen epiglottis (\"thumb sign\") on lateral neck radiograph",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Laryngotracheitis (croup)",
"      </td>",
"      <td>",
"       Typically occurs in children 6 to 36 months; \"barking\" cough, stridor; \"steeple sign\" on anteroposterior neck radiograph",
"      </td>",
"      <td>",
"       <p>",
"        Tapering of upper airway (\"steeple sign\") on anteroposterior neck radiograph",
"       </p>",
"       <p>",
"        Subglottic narrowing and distended hypopharynx on lateral neck radiograph",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Peritonsillar abscess",
"      </td>",
"      <td>",
"       Typically occurs in older children and adolescents; drooling; trismus; muffled voice; tonsillar swelling with deviation of the uvula",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Retropharyngeal abscess",
"      </td>",
"      <td>",
"       Typically occurs in children aged two to four years; neck pain, fever, pain with swallowing; drooling; unwillingness to move the neck; trismus; midline or unilateral swelling of posterior pharyngeal wall",
"      </td>",
"      <td>",
"       Widening of the retropharyngeal space and reversal of the normal cervical spine curvature",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Severe bacterial pneumonia",
"      </td>",
"      <td>",
"       Signs of lower respiratory tract infection (eg, crackles, consolidation)",
"      </td>",
"      <td>",
"       Pulmonary infiltrate with or without parapneumonic effusion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Foreign-body aspiration",
"      </td>",
"      <td>",
"       History of sudden onset of choking (though this history is frequently absent); hoarseness or stridor with laryngeal or upper-esophageal foreign body",
"      </td>",
"      <td>",
"       Visualization of radio-opaque foreign body; upper-esophageal foreign body may cause distortion or deviation of extrathoracic trachea",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Diphtheria",
"      </td>",
"      <td>",
"       Sore throat; malaise; low-grade fever; diphtheritic membrane (exceedingly rare in countries with high rates of diphtheria immunization)",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
