"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Anorectic drugs produce mild to moderate aortic regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 363px; height: 310px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
